import React from 'react';
import {Container,Row,Col} from 'reactstrap'; 
const Header = () => {
    return (
        <div>
            <Container>
              <Row>
                 <Col>
                   AESOP
                </Col>
                <Col>
                   HELLO
                </Col>
                <Col>
                   ANUSH
                </Col>
            </Row>
            </Container>
        </div>
    )
}

export default Header;
